INSERT INTO nlpviewer_backend_document VALUES(44,'project2-doc1-example','{"py/object": "forte.data.data_pack.DataPack", "py/state": {"_text": "During the annual Boston Marathon on April 15, 2013, two homemade pressure cooker bombs detonated 14 seconds and 210 yards (190 m) apart at 2:49 p.m., near the finish line of the race, killing three people and injuring several hundred others, including 16 who lost limbs.\n\nThree days later, the Federal Bureau of Investigation (FBI) released images of two suspects, who were later identified as Chechen Kyrgyzstani-American brothers Dzhokhar Tsarnaev and Tamerlan Tsarnaev. They killed an MIT policeman, kidnapped a man in his car, and had a shootout with the police in nearby Watertown, during which two officers were severely injured, one of whom died a year later. Tamerlan was shot several times, and his brother ran him over while escaping in the stolen car; Tamerlan died soon after.\n\nAn unprecedented manhunt for Dzhokhar ensued on April 19, with thousands of law enforcement officers searching a 20-block area of Watertown; residents of Watertown and surrounding communities were asked to stay indoors, and the transportation system and most businesses and public places closed. Around 6:00 p.m., a Watertown resident discovered Dzhokhar hiding in a boat in his backyard. He was shot and wounded by police before being taken into custody.\n\nDuring questioning, Dzhokhar said that he and his brother were motivated by extremist Islamist beliefs and the wars in Iraq and Afghanistan, that they were self-radicalized and unconnected to any outside terrorist groups, and that he was following his brother''s lead. He said they learned to build explosive devices from an online magazine of the al-Qaeda affiliate in Yemen. He also said they had intended to travel to New York City to bomb Times Square. On April 8, 2015, he was convicted of 30 charges, including use of a weapon of mass destruction and malicious destruction of property resulting in death. Two months later, he was sentenced to death.", "annotations": [{"py/object": "edu.cmu.EventMention", "py/state": {"_embedding": [], "_span": {"begin": 88, "end": 97, "py/object": "forte.data.span.Span"}, "_tid": 0, "event_type": "bombing", "is_valid": null}}, {"py/object": "edu.cmu.EventMention", "py/state": {"_span": {"begin": 185, "end": 192, "py/object": "forte.data.span.Span"}, "is_valid": "True", "_tid": "b5c2a8e8-8048-11ea-8ece-820f078f24c0"}}], "creation_records": {"readers.event_reader.TwoDocumentEventReader": {"py/set": [0]}}, "field_records": {"readers.event_reader.TwoDocumentEventReader": {"py/set": [{"py/tuple": [0, "_event_type"]}]}}, "generics": [], "groups": [], "links": [], "meta": {"py/object": "forte.data.data_pack.Meta", "py/state": {"_pack_id": 1, "doc_id": "00_Abstract", "language": "eng", "span_unit": "character"}}, "orig_text_len": 1902, "processed_original_spans": [], "replace_back_operations": [], "serialization": {"next_id": 3}}}',7);
INSERT INTO nlpviewer_backend_project VALUES(5,replace('{\012  "name": "base_ontology",\012  "definitions": [\012    {\012      "entry_name": "ft.onto.base_ontology.Token",\012      "parent_entry": "forte.data.ontology.top.Annotation",\012      "description": "A span based annotation :class:`Token`, used to represent a token or a word.",\012      "attributes": [\012        {\012          "name": "pos",\012          "type": "str"\012        },\012        {\012          "name": "ud_xpos",\012          "type": "str",\012          "description": "Language specific pos tag. Used in CoNLL-U Format. Refer to https://universaldependencies.org/format.html"\012        },\012        {\012          "name": "lemma",\012          "type": "str",\012          "description": "Lemma or stem of word form."\012        },\012        {\012          "name": "chunk",\012          "type": "str"\012        },\012        {\012          "name": "ner",\012          "type": "str"\012        },\012        {\012          "name": "sense",\012          "type": "str"\012        },\012        {\012          "name": "is_root",\012          "type": "bool"\012        },\012        {\012          "name": "ud_features",\012          "type": "Dict",\012          "key_type": "str",\012          "value_type": "str"\012        },\012        {\012          "name": "ud_misc",\012          "type": "Dict",\012          "key_type": "str",\012          "value_type": "str"\012        }\012      ]\012    },\012    {\012      "entry_name": "ft.onto.base_ontology.Document",\012      "parent_entry": "forte.data.ontology.top.Annotation",\012      "description": "A span based annotation `Document`, normally used to represent a document."\012    },\012    {\012      "entry_name": "ft.onto.base_ontology.Sentence",\012      "parent_entry": "forte.data.ontology.top.Annotation",\012      "description": "A span based annotation `Sentence`, normally used to represent a sentence.",\012      "attributes": [\012        {\012        